import React from "react";

const GreenCard = () => {
  return (
    <div className="flex w-72 gap-3 h-16 border-2 rounded-[90px] border-red-800">
      <div className="bg-green-500 w-14 h-14 rounded-full ml-[2px] items-center ">
        <i class="fa-solid fa-user-doctor text-3xl text-white"></i>
      </div>
      <div className="text-2xl font-semibold">Available</div>
    </div>
  );
};

export default GreenCard;
